var AppIndex=angular.module("AppIndex",[]);function createController(a,o){a.valorTotalVenda=0,a.snValorTotalRecuperado=!1,a.buscaValorTotalVendas=function(){o.post("admin/get").success(function(o){a.valorTotalVenda=o.dados[0].vl_total_venda,a.snValorTotalRecuperado=!0})},angular.element(document).ready(function(){a.buscaValorTotalVendas()})}AppIndex.controller("IndexController",["$scope","$http",createController]);